	/**
  * @author Keith Murphy - nomad - nomadmystics@gmail.com
  * @summary Build the map here
  * @param json
  * @return Promise
  */

	var buildMap = function buildMap(json) {
		console.log('build map called');
		console.log(json);

		var infoWindow = new google.maps.InfoWindow();
		var marker, add;

		// Check passive detection
		detectPassive();

		var initialize = function initialize() {
			console.log('initialize called');
			// Create the map
			var map = new google.maps.Map(document.getElementById('gpsen-partners-map'), {
				zoom: 10,
				center: new google.maps.LatLng(45.523375, -122.676201),
				mapTypeId: google.maps.MapTypeId.ROADMAP
			});
			console.log('map');
			console.log(map);
			// Set the map back center when the user closes the infoWindow
			google.maps.event.addListener(infoWindow, 'closeclick', function () {
				map.setCenter(this.getPosition());
			});

			// Loop through the JSON and create the markers
			for (add = 0; add < json.length; add++) {
				var isLatDefined;
				var isLngDefined;

				// Make sure key and functions exist
				if (typeof json[add]['post-meta-fields'].address === 'undefined') {
					console.log('inside address undefined');
					continue;
				}

				if (typeof json[add]._embedded['wp:featuredmedia'] === 'undefined') {

					json[add]._embedded['wp:featuredmedia'][0].source_url = '';
				}

				if (typeof json[add]['post-meta-fields'].address[1].lat() === 'number') {
					isLatDefined = json[add]['post-meta-fields'].address[1].lat();
				}

				if (typeof json[add]['post-meta-fields'].address[1].lng() === 'number') {
					isLngDefined = json[add]['post-meta-fields'].address[1].lng();
				}

				// Create each marker
				marker = new google.maps.Marker({
					position: new google.maps.LatLng(isLatDefined, isLngDefined),
					map: map,
					id: add

				});

				google.maps.event.addListener(marker, 'click', function (marker, add) {

					// Play defensive
					var featuredImage = json[add]._embedded['wp:featuredmedia'][0].source_url;
					var isFeaturedImage = featuredImage ? featuredImage : '';

					var title = json[add].title.rendered;
					var isTitle = title ? title : '';

					var address = json[add]['post-meta-fields'].address[0];
					var isAddress = address ? address : '';

					var website = json[add]['post-meta-fields'].website;
					var isWebsite = website ? website : '';

					return function () {
						infoWindow.setContent('<img src="' + isFeaturedImage + '">' + '<span>' + '<p style="margin: 1em 0 0 0;"><strong>' + isTitle + '</strong></p>' + '<p style="margin: 0 0 0 0;"><strong>' + isAddress + '</strong></p>' + '<p style="margin: 0 0 0 0;"><strong>Website: </strong>' + '<a href="' + isWebsite + '" target="_blank">' + isWebsite + '</a>' + '</p>' + '</span>' + '<div class="clearBoth"></div>');
						infoWindow.open(map, marker);
					}; // end return function
				}(marker, add));
			} // end for

			// To add the marker to the map, call setMap();
			marker.setMap(map);
			console.log('marker');
			console.log(marker);
			console.log(map);
		}; // End initialize();

		// When the window is loaded create the map
		// google.maps.event.addDomListener(window, 'load', initialize);

		initialize();
		// google.maps.event.addDomListener(window, 'loaded', initialize, supportsPassive ? { passive: true } : false);
	};

